import React from 'react'
import './AboutMe.css'

class AboutMe extends React.Component {
render() {
    return(
      <div className="aboutMe">
        <p>Desarrolladora Front-End de Laboratoria. Destaco por mi creatividad, empatía, puntualidad y organización. Soy una persona multipotencial y autodidacta, lo que me hace aprender de manera rápida cualquier cosa que me proponga, me encanta estar siempre aprendiendo cosas nuevas.
        Mis capacidades comunicacionales, de planificación y adaptabilidad, me permiten desenvolverme en diferentes contextos y equipos de trabajos.
        </p>
      </div>  
    )
}
}

export default AboutMe;
